// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "./AddressArrayLib.sol";
import "./UintArrayLib.sol";

contract RaqamNFT is ERC721, ERC721Enumerable, Ownable {
    //call up functions
    using Strings for uint256;

    // Admin Variables.
    string baseURI;
    uint256 public maxSupply;
    uint256 public VIPPrice;
    uint256 public privatePrice;
    uint256 public pubilcPrice;
    uint256 public VIPLimit;
    uint256 public privateLimit;
    uint256 public publicLimit;
    uint256 public VIPLimitPerUser;
    uint256 public privateLimitPerUser;
    uint256 public limitPerTransaction;

    // required variables.
    address private _withdrawDev = 0x5B38Da6a701c568545dCfcB03FcB875f56beddC4;
    address private _withdrawArt = 0xAb8483F64d9C6d1EcF9b849Ae677dD3315835cb2;
    address private _withdrawRaqam = 0xAb8483F64d9C6d1EcF9b849Ae677dD3315835cb2;
    uint256 private _devShare = 33333; //33.333
    uint256 private _artShare = 33333; // 33.333
    uint256 private _precesionValue = 1000;
    string public contractURI;

    //contract states
    uint256 public vipAmountMinted;
    uint256 public publicAmountMinted;
    uint256 public privateAmountMinted;
    bool public presaleLive;
    bool public vipLive;
    bool public saleLive;
    bool public locked;

    // Storing private and VIP users.
    using AddressArrayLib for AddressArrayLib.addresses;
    AddressArrayLib.addresses privateUsers;
    AddressArrayLib.addresses VIPUsers;

    //Reserved token variables
    using UintArrayLib for UintArrayLib.uints;
    UintArrayLib.uints reserveTokens;

    // Auto-Number generation.
    uint256 private tokenIdIndex;

    mapping(address => uint256) public presalerListPurchases;
    mapping(address => uint256) public vipListPurchases;

    // Constructor
    constructor(
        string memory baseURI_,
        string memory _contrctURI,
        uint256 _VIPPrice,
        uint256 _privatePrice,
        uint256 _publicPrice,
        uint256 _VIPLimit,
        uint256 _privateLimit,
        uint256 _publicLimit,
        uint256 _VIPLimitPerUser,
        uint256 _privateLimitPerUser,
        uint256 _limitPerTransaction
    ) ERC721("Raqam", "RQM") {
        baseURI = baseURI_;
        contractURI = _contrctURI;
        VIPPrice = _VIPPrice;
        privatePrice = _privatePrice;
        pubilcPrice = _publicPrice;
        maxSupply = _VIPLimit + _privateLimit + _publicLimit;
        VIPLimit = _VIPLimit;
        privateLimit = _privateLimit;
        publicLimit = _publicLimit;
        VIPLimitPerUser = _VIPLimitPerUser;
        privateLimitPerUser = _privateLimitPerUser;
        limitPerTransaction = _limitPerTransaction;
        _transferOwnership(msg.sender);
        tokenIdIndex = 1;
    }

    modifier notLocked() {
        require(!locked, "Contract metadata methods are locked");
        _;
    }

    // Method to add private users.
    function addPrivateUsers(address[] memory users) public onlyOwner {
        // Loop through users:
        for (uint256 index = 0; index < users.length; index++) {
            privateUsers.add(users[index]);
        }
    }

    // Method to remove all private users.
    function removePrivateUsers(address[] memory users) public onlyOwner {
        // Loop through users:
        for (uint256 index = 0; index < users.length; index++) {
            privateUsers.remove(users[index]);
        }
    }

    // Method to check if user is private user
    function isUserPrivate(address user) public view returns (bool) {
        return privateUsers.exists(user);
    }

    // Method to get all private users
    function getPrivateUsers() public view returns (address[] memory) {
        return privateUsers.array;
    }

    // Method to add VIP users.
    function addVIPUsers(address[] memory users) public onlyOwner {
        // Loop through users:
        for (uint256 index = 0; index < users.length; index++) {
            VIPUsers.add(users[index]);
        }
    }

    // Method to remove all VIP users.
    function removeVIPUsers(address[] memory users) public onlyOwner {
        // Loop through users:
        for (uint256 index = 0; index < users.length; index++) {
            VIPUsers.remove(users[index]);
        }
    }

    // Method to check if user is VIP user
    function isUserVIP(address user) public view returns (bool) {
        return VIPUsers.exists(user);
    }

    // Method to get all VIP users
    function getVIPUsers() public view returns (address[] memory) {
        return VIPUsers.array;
    }

    //allows users to mint a Raqam
    function buy(uint256 tokenQuantity) external payable {
        require(saleLive && !presaleLive && !vipLive, "Sale_CLOSED");

        require(totalSupply() < maxSupply, "OUT_OF_STOCK");
        require(
            publicAmountMinted + tokenQuantity <= publicLimit,
            "EXCEED_PUBLIC"
        );
        require(tokenQuantity <= limitPerTransaction, "EXCEED_RQ_PER_MINT");
        require(pubilcPrice * tokenQuantity <= msg.value, "INSUFFICIENT_ETH");

        for (uint256 i = 0; i < tokenQuantity; i++) {
            publicAmountMinted++;
            _mint(msg.sender, getAvailbleTokenId());
            tokenIdIndex++;
        }
    }

    function presaleBuy(uint256 tokenQuantity) external payable {
        require(!saleLive && presaleLive && !vipLive, "PRESALE_CLOSED");
        require(isUserPrivate(msg.sender), "NOT_QUALIFIED");
        require(totalSupply() < maxSupply, "OUT_OF_STOCK");
        require(
            privateAmountMinted + tokenQuantity <= privateLimit,
            "EXCEED_PRIVATE"
        );
        require(
            presalerListPurchases[msg.sender] + tokenQuantity <=
                privateLimitPerUser,
            "EXCEED_ALLOC"
        );
        require(privatePrice * tokenQuantity <= msg.value, "INSUFFICIENT_ETH");

        for (uint256 i = 0; i < tokenQuantity; i++) {
            privateAmountMinted++;
            presalerListPurchases[msg.sender]++;
            _mint(msg.sender, getAvailbleTokenId());
            tokenIdIndex++;
        }
    }

    function VIPBuy(uint256 tokenQuantity) external payable {
        require(!saleLive && !presaleLive && vipLive, "VIP_CLOSED");
        require(isUserVIP(msg.sender), "NOT_QUALIFIED");
        require(totalSupply() < maxSupply, "OUT_OF_STOCK");
        require(vipAmountMinted + tokenQuantity <= VIPLimit, "EXCEED_VIP");
        require(
            vipListPurchases[msg.sender] + tokenQuantity <= VIPLimitPerUser,
            "EXCEED_ALLOC"
        );
        require(VIPPrice * tokenQuantity <= msg.value, "INSUFFICIENT_ETH");

        for (uint256 i = 0; i < tokenQuantity; i++) {
            vipAmountMinted++;
            vipListPurchases[msg.sender]++;
            _mint(msg.sender, getAvailbleTokenId());
            tokenIdIndex++;
        }
    }

    // Owner functions for enabling presale, sale, revealing and setting the provenance hash
    function lockMetadata() external onlyOwner {
        locked = true;
    }

    function stratPresale() external onlyOwner {
        saleLive = false;
        vipLive = false;
        presaleLive = true;
    }

    function startSale() external onlyOwner {
        vipLive = false;
        presaleLive = false;
        saleLive = true;
    }

    function stratVIPSale() external onlyOwner {
        saleLive = false;
        presaleLive = false;
        vipLive = true;
    }

    function stopAllSale() external onlyOwner {
        saleLive = false;
        presaleLive = false;
        vipLive = false;
    }

    function setContractURI(string calldata URI) external onlyOwner notLocked {
        contractURI = URI;
    }

    function setBaseURI(string calldata URI) external onlyOwner notLocked {
        baseURI = URI;
    }

    function tokenURI(uint256 tokenId)
        public
        view
        override(ERC721)
        returns (string memory)
    {
        require(_exists(tokenId), "Cannot query non-existent token");

        return string(abi.encodePacked(baseURI, tokenId.toString()));
    }

    function withdraw() external onlyOwner {
        uint256 devShare = (address(this).balance * _devShare) /
            (100 * _precesionValue);
        uint256 artShare = (address(this).balance * _artShare) /
            (100 * _precesionValue);
        uint256 raqamShare = address(this).balance - devShare - artShare;
        payable(_withdrawDev).transfer(devShare);
        payable(_withdrawArt).transfer(artShare);
        payable(_withdrawRaqam).transfer(raqamShare);
    }

    function reserveNFTs(uint256[] memory tokenIds) external onlyOwner {
        for (uint256 i = 0; i < tokenIds.length; i++) {
            require(ownerOf(tokenIds[i]) == address(0), "NFT already sold.");
            reserveTokens.add(tokenIds[i]);
        }
    }

    function getAvailbleTokenId() private returns (uint256) {
        while (reserveTokens.exists(tokenIdIndex)) {
            require(tokenIdIndex < maxSupply, "No Token Available");
            tokenIdIndex++;
        }
        return tokenIdIndex;
    }

    function airdrop(address[] memory _toAddresses, uint256[] memory _tokenIds)
        public
        onlyOwner
    {
        require(
            _toAddresses.length == _tokenIds.length,
            "Length should be same between '_toAddresses' and '_tokenIds'"
        );

        for (uint256 i = 0; i < _toAddresses.length; i++) {
            require(reserveTokens.exists(_tokenIds[i]), "NFT is not reserved");
            _mint(_toAddresses[i], _tokenIds[i]);
            reserveTokens.remove(_tokenIds[i]);
        }
    }

    function getReserveTokens() public returns (uint256[] memory) {
        return reserveTokens.array;
    }

    function _beforeTokenTransfer(
        address from,
        address to,
        uint256 tokenId
    ) internal virtual override(ERC721, ERC721Enumerable) {
        super._beforeTokenTransfer(from, to, tokenId);
    }

    function supportsInterface(bytes4 interfaceId)
        public
        view
        virtual
        override(ERC721, ERC721Enumerable)
        returns (bool)
    {
        super.supportsInterface(interfaceId);
    }
}
